import { ReactNode } from 'react';

const Button = ({ children }: { children?: ReactNode }) => {
	return (
		<a className="bg-primary-color py-3 px-8 text-primary-text font-medium rounded-full">
			{children}
		</a>
	);
};

export default Button;
